The URL returned in the callback field brings the client to a paginated result. The callback endpoint specification follows: GET /notifier/api/v1/notification/{id}?[page_size=N][next=N]
{ page: { size: int, // maximum number of notifications in the response next: string, // if present, the next id to fetch. } notifications: [ Notification… ] // array of notifications; max len == page.size
} The GET callback request implements a simple bare-minimum paging mechanism. The "page_size" url param controls how many notifications are returned in a single page. If not provided a default of 500 is used. The "next" url param informs Clair the next set of paged notifications to return. If not provided the 0th page is assumed. A page object accompanying the notification list specifies "next" and "size" fields. The "next" field returned in the page must be provided as the subsequent request's "next" url parameter to retrieve the next set of notifications. The "size" field will simply echo back the request page_size parameter. When the final page is served to the client the returned "page" data structure will not contain a "next" member. Therefore the following loop is valid for obtaining all notifications for a notification id in pages of a specified size. { page, notifications } = http.Get("http://clairv4/notifier/api/v1/notification/{id}?page_size=1000") while (page.Next != None) { { page, notifications } = http.Get("http://clairv4/notifier/api/v1/notification/{id}?next={page.Next},page_size=1000")
} Note: If the client specifies a custom page_size it must specify this page_size on every request for accurate responses.

